export function Home(){
    return(
        <div>
            <aside>
                <img src={IllustrationImg} alt="Ilustração simbolizando perguntas e respostas" />
                <strong>Crie salar de Q&A ao-vivo</strong>
            </aside>
        </div>
    )
}
